import { useEffect } from 'react';

function SignInCheck({ setIsSignIn }) {
    useEffect(() => {
        const signInCheck = async () => {
            try {
                const res = await fetch(`${process.env.REACT_APP_SERVER_URL}/user/signin/success`, {
                    headers: {
                        'Content-Type': 'application/json'
                    },
                    credentials: 'include'
                })
                if (res.ok) {
                    setIsSignIn(true)
                } else {
                    setIsSignIn(false)
                }
            } catch (error) {
                console.log(error);
            }
        }
        signInCheck()
    }, []);


    return null;
}


export default SignInCheck;
